import "./App.css";

function Heading() {
  return <h1>My Favourite Cities</h1>;
}

function App() {
  return (
    <div>
      <Heading />
      <ul>
        <li>Bengaluru</li>
        <li>Mumbai</li>
        <li>Delhi</li>
      </ul>
    </div>
  );
}

export default App;
